由于我是一個AI語言模型,我沒有能力知道每個意大利人每個星期天的早上都做什麼事情。不過,我可以提供一些常見的意大利傳統和習俗,例如:


1. 在星期天,許多意大利人會傳統上, 1月1日是主保羅节 (即主保羅节),會在教堂前排祈禱;
2. 在12月20日,意大利人會傳統上, 他们会去梵蒂冈朝拜;


3.在3月10日是圣枝主日, 意大利人會傳統上, 他们会去罗马竞技场参加主保节


4.在4月17日是圣乔治节,意大利人傳統上是去教堂唱赞美诗班的咏叹,然后去共进晚餐


因此, 意大利人在星期天通常會做什麼事情并没有一個確定的答案, 而是會根据不同地区和不同社区的传统习俗和风俗而有所不同。
